INSERT INTO `prodotti` VALUES (1,'Olio Extravergine di Oliva 1L','L\'olio extra vergine di oliva e\' un olio di alta qualita\' ottenuto dalla spremitura a freddo delle olive, senza l\'uso di sostanze chimiche o processi industriali. Questo processo conserva tutte le proprieta\' organolettiche e nutrizionali dell\'oliva, conferendo all\'olio un gusto ricco e un profilo nutrizionale eccezionale.\n- 100% Naturale: L\'olio EVO e\' puro e non raffinato, mantenendo intatte tutte le sostanze nutritive e antiossidanti.\n- Acidita\' Bassa: L\'acidita\' dell\'olio extra vergine di oliva e\' inferiore allo 0,8%, un indicatore di qualita\' e freschezza.\n- Gusto e Aroma: Possiede un sapore fruttato e leggermente piccante, con note di erba fresca, mandorla e a volte un retrogusto leggermente amaro, che varia a seconda della varieta\' di olive utilizzate e della regione di produzione.\n',15,10,4,300,'1L',0,'classici','2023','-'),(2,'Olio Extravergine di Oliva 3L','L\'olio extra vergine di oliva e\' un olio di alta qualita\' ottenuto dalla spremitura a freddo delle olive, senza l\'uso di sostanze chimiche o processi industriali. Questo processo conserva tutte le proprieta\' organolettiche e nutrizionali dell\'oliva, conferendo all\'olio un gusto ricco e un profilo nutrizionale eccezionale.\n- 100% Naturale: L\'olio EVO e\' puro e non raffinato, mantenendo intatte tutte le sostanze nutritive e antiossidanti.\n- Acidita\' Bassa: L\'acidita\' dell\'olio extra vergine di oliva e\' inferiore allo 0,8%, un indicatore di qualita\' e freschezza.\n- Gusto e Aroma: Possiede un sapore fruttato e leggermente piccante, con note di erba fresca, mandorla e a volte un retrogusto leggermente amaro, che varia a seconda della varieta\' di olive utilizzate e della regione di produzione.\n',45,10,4,100,'3L',0,'classici','2023','-'),(3,'Olio Extravergine di Oliva 5L','L\'olio extra vergine di oliva e\' un olio di alta qualita\' ottenuto dalla spremitura a freddo delle olive, senza l\'uso di sostanze chimiche o processi industriali. Questo processo conserva tutte le proprieta\' organolettiche e nutrizionali dell\'oliva, conferendo all\'olio un gusto ricco e un profilo nutrizionale eccezionale.\n- 100% Naturale: L\'olio EVO e\' puro e non raffinato, mantenendo intatte tutte le sostanze nutritive e antiossidanti.\n- Acidita\' Bassa: L\'acidita\' dell\'olio extra vergine di oliva e\' inferiore allo 0,8%, un indicatore di qualita\' e freschezza.\n- Gusto e Aroma: Possiede un sapore fruttato e leggermente piccante, con note di erba fresca, mandorla e a volte un retrogusto leggermente amaro, che varia a seconda della varieta\' di olive utilizzate e della regione di produzione.\n',75,10,4,120,'5L',0,'classici','2023','-'),(4,'EVO Aromatizzato al Limone 0.5L','L\'olio aromatizzato dei Fratelli Muraca e\' un condimento di qualita\' eccellente, ottenuto aggiungendo il sapore fresco dei prodotti tipici e biologici calabresi, all\'olio extravergine d\'oliva 100% italiano.',7.99,10,4,100,'0.5L',0,'aromatizzati','2023','Il Limone di Calabria della Costa dei Gelsomini è una pregiata varietà di limone antica, nata dalla mutazione spontanea del Femminello comune. Si distingue per la buccia fine con un profumo eccellente e ricchissima di oli essenziali e il succo abbondante. Perfetto per qualsiasi piatto, dalle bruschette ai primi e secondi di pesce e carni bianche, l\'olio al limone è proposto in bottiglie di vetro, per conservare fragranze e delicatezza nel tempo. '),(5,'EVO Aromatizzato al Peperoncino 0.5L','L\'olio aromatizzato dei Fratelli Muraca e\' un condimento di qualita\' eccellente, ottenuto aggiungendo il sapore fresco dei prodotti tipici e biologici calabresi, all\'olio extravergine d\'oliva 100% italiano.',7.99,10,4,100,'0.5L',0,'aromatizzati','2023','Il Peperoncino Calabrese è di un rosso intenso e la piccantezza giusta che dà corposità e sapore unico ai piatti. Questo peperoncino è ricco in provitamina A e vitamina C consumato a crudo e possiede proprietà antisettiche, digestive e vasodilatatorie, per cui è tradizionalmente riconosciuto come un \"afrodisiaco\" naturale.'),(6,'EVO Aromatizzato al Rosmarino 0.5L','L\'olio aromatizzato dei Fratelli Muraca e\' un condimento di qualita\' eccellente, ottenuto aggiungendo il sapore fresco dei prodotti tipici e biologici calabresi, all\'olio extravergine d\'oliva 100% italiano.',7.99,10,4,100,'0.5L',0,'aromatizzati','2023','Il Rosmarino Montosco è coltivato Calabria, viene essiccato naturalmente e pertanto mantiene un colore verde chiaro e un profumo intenso che si sprigiona maggiormente nel momento in cui viene macinato o frantumato l\'ago. Esalta i sapori naturali, infatti il suo aroma deciso lo rende perfetto per essere utilizzato a crudo su piatti di carne, pesce, verdure o su insalate fresche.'),(7,'EVO Aromatizzato al Limone 250mL','L\'olio aromatizzato dei Fratelli Muraca e\' un condimento di qualita\' eccellente, ottenuto aggiungendo il sapore fresco dei prodotti tipici e biologici calabresi, all\'olio extravergine d\'oliva 100% italiano.',5.99,5,4,50,'250ml',0,'aromatizzati','2023','Il Limone di Calabria della Costa dei Gelsomini è una pregiata varietà di limone antica, nata dalla mutazione spontanea del Femminello comune. Si distingue per la buccia fine con un profumo eccellente e ricchissima di oli essenziali e il succo abbondante. Perfetto per qualsiasi piatto, dalle bruschette ai primi e secondi di pesce e carni bianche, l\'olio al limone è proposto in bottiglie di vetro, per conservare fragranze e delicatezza nel tempo. '),(8,'EVO Aromatizzato al Peperoncino 250mL','L\'olio aromatizzato dei Fratelli Muraca e\' un condimento di qualita\' eccellente, ottenuto aggiungendo il sapore fresco dei prodotti tipici e biologici calabresi, all\'olio extravergine d\'oliva 100% italiano.',5.99,5,4,50,'250ml',0,'aromatizzati','2023','Il Peperoncino Calabrese è di un rosso intenso e la piccantezza giusta che dà corposità e sapore unico ai piatti. Questo peperoncino è ricco in provitamina A e vitamina C consumato a crudo e possiede proprietà antisettiche, digestive e vasodilatatorie, per cui è tradizionalmente riconosciuto come un \"afrodisiaco\" naturale.'),(9,'EVO Aromatizzato al Rosmarino 250mL','L\'olio aromatizzato dei Fratelli Muraca e\' un condimento di qualita\' eccellente, ottenuto aggiungendo il sapore fresco dei prodotti tipici e biologici calabresi, all\'olio extravergine d\'oliva 100% italiano.',5.99,5,4,50,'250ml',0,'aromatizzati','2023','Il Rosmarino Montosco è coltivato Calabria, viene essiccato naturalmente e pertanto mantiene un colore verde chiaro e un profumo intenso che si sprigiona maggiormente nel momento in cui viene macinato o frantumato l\'ago. Esalta i sapori naturali, infatti il suo aroma deciso lo rende perfetto per essere utilizzato a crudo su piatti di carne, pesce, verdure o su insalate fresche.'),(10,'EVO Aromatizzato al Peperoncino (gusto moderato) 250mL','L\'olio aromatizzato dei Fratelli Muraca e\' un condimento di qualita\' eccellente, ottenuto aggiungendo il sapore fresco dei prodotti tipici e biologici calabresi, all\'olio extravergine d\'oliva 100% italiano.',6.99,0,4,50,'250ml',0,'aromatizzati','2023','Il Peperoncino Calabrese è di un rosso intenso e la piccantezza giusta che dà corposità e sapore unico ai piatti. Questo peperoncino è ricco in provitamina A e vitamina C consumato a crudo e possiede proprietà antisettiche, digestive e vasodilatatorie, per cui è tradizionalmente riconosciuto come un \"afrodisiaco\" naturale.'),(11,'EVO Aromatizzato al Peperoncino (gusto forte) 250mL','L\'olio aromatizzato dei Fratelli Muraca e\' un condimento di qualita\' eccellente, ottenuto aggiungendo il sapore fresco dei prodotti tipici e biologici calabresi, all\'olio extravergine d\'oliva 100% italiano.',7.99,0,4,25,'250ml',0,'aromatizzati','2023','Il Peperoncino Calabrese è di un rosso intenso e la piccantezza giusta che dà corposità e sapore unico ai piatti. Questo peperoncino è ricco in provitamina A e vitamina C consumato a crudo e possiede proprietà antisettiche, digestive e vasodilatatorie, per cui è tradizionalmente riconosciuto come un \"afrodisiaco\" naturale.'),(12,'Detergente Viso EVO','L\'olio di oliva e\' caratterizzato da proprieta\' idratanti, tonificanti e antiossidanti, con presenza di sostanze come: la vitamina E, la vitamina A, responsabile della rigenerazione cutanea, gli acidi oleici che rendono la pelle morbida ed elastica, e i polifenoli, antiossidanti naturali, che nutrono la pelle e la proteggono dai danni degli agenti atmosferici e del tempo che passa. Tra i benefici dell\'olio di oliva sulla pelle del viso, c\'e\' la sua funzione detergente.\nL\'olio di oliva e\' in grado di sciogliere sporco, smog, sebo e trucco presenti sulla pelle con un\'azione profonda, ma delicata.\nUSO: applicare direttamente su viso e collo asciutti, inumidire per emulsionare il prodotto, massaggiare e risciacquare con acqua tipeida.\nPRIVO di: parabeni, SLS, SLES, petrolati, siliconi e coloranti artificiali. Non testato sugli animali.',14.99,15,22,100,'50ml',1,'cosmetici','2022','Prunus Amygdalus Dulcis (Sweet Almond) Oil, Ethylhexyl Stearate, Persea Gratissima (Avocado) Oil, Hydrogenated Vegetable Oil, Isoamyl Laurate, Olea Europaea (Olive) Fruit Oil*, Aqua (Water), Lauryl Glucoside, Polyglyceryl-2 Dipolyhydroxystearate, Glycerin, Squalane, Helianthus Annuus (Sunflower) Seed Oil, Rosa Canina Fruit Extract, Tocopherol, Parfum (Fragrance).\n* Da Agricoltura Biologica'),(13,'Saponetta EVO','Realizzata con ingredienti naturali di alta qualita\', questa saponetta offre una cura delicata per la pelle, rispettando l\'ambiente.\nBenefici:\nIdratazione Profonda: L\'olio d\'oliva penetra in profondita\' nella pelle, fornendo un\'idratazione duratura e prevenendo la secchezza.\nProprieta\' Lenitive: Ideale per le pelli sensibili e irritate, grazie alle sue proprieta\' calmanti e lenitive.\nNaturale e Sostenibile: Senza parabeni, solfati, e sostanze chimiche aggressive. Completamente biodegradabile, rispetta l\'ambiente e non inquina.\nVersatile: Puo\' essere utilizzata su viso, corpo e mani, offrendo una cura completa e naturale per la pelle.\nUtilizzo: Bagna la saponetta e strofinala tra le mani o su una spugna per creare una schiuma ricca. Massaggia delicatamente sulla pelle umida, quindi risciacqua abbondantemente con acqua tiepida. Per una durata maggiore, conserva la saponetta in un luogo asciutto tra un uso e l\'altro.\nPackaging La saponetta e\' confezionata in un elegante e sostenibile imballaggio in carta riciclata, perfetta anche come idea regalo. Ogni saponetta pesa circa 100 grammi e ha una forma ergonomica che si adatta comodamente alla mano.',4.99,0,22,250,'100g',1,'cosmetici','2022','Olio d\'oliva, acqua distillata, soda caustica, amido di mais, olio essenziale di lavanda\nOlio d\'Oliva Extra Vergine: Conosciuto per le sue proprieta\' idratanti e nutrienti, l\'olio d\'oliva extra vergine e\' l\'ingrediente principale della nostra saponetta. Ricco di antiossidanti, vitamine A ed E, aiuta a proteggere la pelle dai danni dei radicali liberi e a mantenere un aspetto giovane e sano.\nOli Essenziali: A seconda della variante, possono essere aggiunti oli essenziali come lavanda, rosmarino o tea tree per offrire ulteriori benefici aromaterapici e per la pelle.'),(14,'Eleganza Mediterranea - Box di Cosmetici Naturali','Immergiti nella pura essenza della natura con la nostra esclusiva box di cosmetici \"Eleganza Mediterranea\". Questo set raffinato e\' il regalo perfetto per chi cerca prodotti di bellezza naturali e di alta qualita\'. La box contiene due gioielli della cosmetica artigianale: una saponetta e un detergente viso, entrambi arricchiti con olio extravergine di oliva.\n\nContenuto della Box:\n1.	Saponetta all\'Olio Extravergine di Oliva:\n    - Descrizione: Questa saponetta e\' realizzata con olio extravergine di oliva puro, noto per le sue proprieta\' idratanti e nutrienti. La sua formula delicata e\' ideale per tutti i tipi di pelle, anche le piu\' sensibili. Grazie all\'olio d\'oliva, la pelle viene detersa in profondita\' senza perdere la sua naturale morbidezza.\n    - Benefici: Idratazione intensa, nutrimento profondo, proprieta\' antiossidanti, aiuta a mantenere l\'elasticita\' della pelle.\n    - Aroma: Un profumo fresco e naturale che richiama le colline olivetate del Mediterraneo.\n2.	Detergente Viso all\'Olio Extravergine di Oliva:\n    - Descrizione: Un detergente viso delicato, studiato per rimuovere impurita\' e trucco senza alterare il naturale equilibrio della pelle. La presenza dell\'olio extravergine di oliva garantisce un\'azione emolliente e rigenerante, lasciando la pelle pulita e setosa al tatto.\n    - Benefici: Deterge in profondita\', rimuove il trucco e le impurita\', non secca la pelle, lascia una sensazione di freschezza e morbidezza.\n    - Aroma: Una fragranza delicata e avvolgente che rievoca i sentori della natura mediterranea.\n\nCaratteristiche Aggiuntive:\n    Ingredienti Naturali: Entrambi i prodotti sono formulati con ingredienti naturali, senza parabeni, solfati o siliconi.\n    Eco-Friendly: Packaging eco-sostenibile e riciclabile, in linea con il nostro impegno per la salvaguardia dell\'ambiente.\n    Artigianalita\': Prodotti realizzati a mano, con passione e dedizione, seguendo le antiche tradizioni cosmetiche.\nIdeale per:\n    Un regalo speciale per se\' stessi o per una persona cara.\n    Chi desidera prendersi cura della propria pelle con prodotti naturali e di alta qualita\'.\n    Amanti dei prodotti eco-sostenibili e artigianali.\n\nScopri la bellezza autentica e naturale del Mediterraneo con la nostra box di cosmetici \"Eleganza Mediterranea\". Un viaggio sensoriale che trasformera\' la tua routine di bellezza in un momento di puro piacere.',22,10,22,50,'-',1,'cosmetici','2024','-'),(15,'Bundle Eccellenza Mediterranea','Scopri il gusto autentico del Mediterraneo con il nostro bundle \"Eccellenza Mediterranea\", una collezione esclusiva di oli extravergine di oliva e una saponetta artigianale all\'olio d\'oliva, presentati in un elegante contenitore di legno riciclato di ulivo. Questo set e\' perfetto per i veri intenditori del gusto e della bellezza naturale.\n\nContenuto del Bundle:\n1.	3 Bottiglie di Olio Extravergine di Oliva da 1L:\n    Descrizione: Tre bottiglie di pregiato olio extravergine di oliva, ottenuto da olive selezionate e spremute a freddo per conservare tutte le proprieta\' organolettiche. Questo olio e\' ideale per esaltare i sapori dei tuoi piatti preferiti.\n    Benefici: Ricco di antiossidanti, vitamine e acidi grassi essenziali, perfetto per una cucina sana e gustosa.\n    Utilizzo: Ottimo per condire insalate, verdure, carni, pesce e per preparazioni culinarie raffinate.\n2.	3 Bottiglie di Olio Extravergine di Oliva Aromatizzate da 250ml:\n    Olio al Limone: Un\'armoniosa combinazione di olio extravergine di oliva e limoni freschi. Perfetto per insaporire pesce, frutti di mare e insalate estive.\n    Olio al Rosmarino: Un blend aromatico che unisce l\'olio extravergine di oliva con il rosmarino, ideale per arrosti, patate e carni grigliate.\n    Olio al Peperoncino: Un olio piccante e vivace, ottenuto dall\'infusione di peperoncino nell\'olio extravergine di oliva. Perfetto per dare un tocco speziato a pizze, paste e bruschette.\n3.	Saponetta Artigianale all\'Olio Extravergine di Oliva:\n    Descrizione: Una saponetta naturale realizzata con olio extravergine di oliva, conosciuto per le sue proprieta\' idratanti e nutrienti. Delicata sulla pelle, e\' adatta a tutti i tipi di pelle, anche le piu\' sensibili.\n    Benefici: Deterge delicatamente, idrata in profondita\' e lascia la pelle morbida e setosa.\nContenitore di Legno Riciclato di Ulivo:\n    Descrizione: Un raffinato contenitore realizzato in legno riciclato di ulivo, un materiale eco-sostenibile e di grande bellezza. Ogni pezzo e\' unico e porta con se\' la storia e il fascino del Mediterraneo.\n    Utilizzo: Dopo aver utilizzato i prodotti, il contenitore puo\' essere riutilizzato come elegante portaoggetti o elemento decorativo.\nCaratteristiche Aggiuntive:\n    Naturale e Sostenibile: Tutti i prodotti sono realizzati con ingredienti naturali e confezionati in modo eco-sostenibile.\n    Alta Qualita\': Oli extravergine di oliva di alta qualita\', ottenuti attraverso metodi di produzione tradizionali.\n    Artigianalita\': La saponetta e il contenitore di legno sono realizzati artigianalmente, con grande cura e attenzione ai dettagli.\n\nIdeale per:\n    Un regalo speciale per gli amanti della cucina e dei prodotti naturali.\n    Chi desidera portare un tocco di lusso e autenticita\' nella propria cucina.\n    Amanti dei prodotti eco-sostenibili e artigianali.\nCon il bundle \"Eccellenza Mediterranea\", porti a casa tua il meglio della tradizione e della qualita\' del Mediterraneo. Un\'esperienza unica che combina gusto, benessere e sostenibilita\'.',65,10,22,50,'-',0,'classici','2024','-');
